a sequence of age values\n","age_seq = seq(min(df$age), max(df$age), length.out = 100)\n","\n","# Generate predictions and plot for the optimal degree from ANOVA\n","X_seq = as.matrix(poly(age_seq, optimal_degree_anova, raw = TRUE))\n","predicted_wage_anova = predict(models[[optimal_degree_anova]], newdata = list(X = X_seq))\n","\n","# Generate predictions for the optimal degree from CV\n","X_seq = as.matrix(poly(age_seq, optimal_degree_cv, raw = TRUE))\n","predicted_wage_cv = predict(models[[optimal_degree_cv]], newdata = list(X = X_seq))\n","\n","# Plot the data and the polynomial fit\n","plot(df$age, df$wage, xlab = \"Age\", ylab = \"Wage\", main = \"Polynomial Regression Fit\")\n","lines(age_seq, predicted_wage_anova, col = \"red\", lwd = 2)\n","lines(age_seq, predicted_wage_cv, col = \"blue\", lwd = 2)\n","legend(\"topright\", legend=c(\"ANOVA\", \"CV\"), col=c(\"red\", \"blue\"), lty = 1)\n"]},{"cell_type":"markdown","id":"ce8c8170","metadata":{"papermill":{"duration":0.052326,"end_time":"2023-07-04T18:05:54.772466","exception":false,"start_time":"2023-07-04T18:05:54.72014","status":"completed"},"tags":[]},"source":["# FIX ME"]},{"cell_type":"markdown","id":"6bb3e728","metadata":{"papermill":{"duration":0.067563,"end_time":"2023-07-04T18:05:54.890332","exception":false,"start_time":"2023-07-04T18:05:54.822769","status":"completed"},"tags":[]},"source":["#### (b) Fit a step function to predict wage using age, and perform crossvalidation to choose the optimal number of cuts. Make a plot of the fit obtained."]},{"cell_type":"code","execution_count":20,"id":"e272d8cc","metadata":{"execution":{"iopub.execute_input":"2023-07-04T18:05:55.003743Z","iopub.status.busy":"2023-07-04T18:05:55.00181Z","iopub.status.idle":"2023-07-04T18:06:02.050728Z","shell.execute_reply":"2023-07-04T18:06:02.048431Z"},"papermill":{"duration":7.1117,"end_time":"2023-07-04T18:06:02.061102","exception":false,"start_time":"2023-07-04T18:05:54.949402","status":"completed"},"tags":[]},"outputs":