n","colnames(cv_results) = c(\"Cuts\", \"RMSE\")\n","print(cv_results)\n","\n","optimal_cuts = cv_results$Cuts[which.min(cv_results$RMSE)]\n","print(paste(\"The optimal number of cuts by cross-validation is:\", optimal_cuts))\n","\n","df$age_cut = cut(df$age, breaks = optimal_cuts)\n","fit_optimal = lm(wage ~ age_cut, data = df)\n","age_seq = seq(min(df$age), max(df$age), length.out = 100)\n","df_seq = data.frame(age = age_seq, age_cut = cut(age_seq, breaks = optimal_cuts))\n","predicted_wage = predict(fit_optimal, newdata = df_seq)\n","\n","plot(df$age, df$wage, xlab = \"Age\", ylab = \"Wage\", main = \"Step Function Fit\")\n","lines(age_seq, predicted_wage, col = \"red\", type = \"s\")\n"]},{"cell_type":"markdown","id":"e6efeae3","metadata":{"papermill":{"duration":0.059281,"end_time":"2023-07-04T18:06:02.181616","exception":false,"start_time":"2023-07-04T18:06:02.122335","status":"completed"},"tags":[]},"source":["# FIX ME"]},{"cell_type":"markdown","id":"f18a8b93","metadata":{"papermill":{"duration":0.057933,"end_time":"2023-07-04T18:06:02.297237","exception":false,"start_time":"2023-07-04T18:06:02.239304","status":"completed"},"tags":[]},"source":["### 9. This question uses the variables dis (the weighted mean of distances to five Boston employment centers) and nox (nitrogen oxides concentration in parts per 10 million) from the Boston data. We will treat dis as the predictor and nox as the response.\n","#### (a) Use the poly() function to fit a cubic polynomial regression to predict nox using dis. Report the regression output, and plot the resulting data and polynomial fits.\n"]},{"cell_type":"code","execution_count":21,"id":"332329b2","metadata":{"execution":{"iopub.execute_input":"2023-07-04T18:06:02.417071Z","iopub.status.busy":"2023-07-04T18:06:02.415337Z","iopub.status.idle":"2023-07-04T18:06:02.678529Z","shell.execute_reply":"2023-07-04T18:06:02.676594Z"},"papermill":{"duration":0.328537,"end_time":"2023-07-04T18:06:02.683687","exception":false,"start_ti