els[[d]] = model\n","  if(d > 1){\n","    anova_res = anova(models[[d-1]], model)\n","    anova_results = rbind(anova_results, c(d, anova_res$\"Pr(>F)\"[2]))\n","  }\n","  \n","  fmla = as.formula(paste(\"nox ~ poly(dis,\", d, \")\"))\n","  set.seed(42)  \n","  model_cv = train(fmla, data = df, method = \"lm\", trControl = ctrl)\n","  res = model_cv$resample\n","  cv_results = rbind(cv_results, c(d, mean(res$RMSE)))\n","}\n","\n","colnames(anova_results) = c(\"Degree\", \"P-Value\")\n","colnames(cv_results) = c(\"Degree\", \"RMSE\")\n","results = merge(anova_results, cv_results, by = \"Degree\")\n","print(\"ANOVA and Cross-validation Results\")\n","print(results)\n","\n","optimal_degree_anova = results$Degree[which.min(results$`P-Value`)]\n","optimal_degree_cv = results$Degree[which.min(results$RMSE)]\n","print(paste(\"The optimal degree by ANOVA is:\", optimal_degree_anova))\n","print(paste(\"The optimal degree by cross-validation is:\", optimal_degree_cv))\n","\n","\n"]},{"cell_type":"code","execution_count":25,"id":"a9ee6a54","metadata":{"execution":{"iopub.execute_input":"2023-07-04T18:06:07.21334Z","iopub.status.busy":"2023-07-04T18:06:07.210457Z","iopub.status.idle":"2023-07-04T18:06:07.518915Z","shell.execute_reply":"2023-07-04T18:06:07.515413Z"},"papermill":{"duration":0.389341,"end_time":"2023-07-04T18:06:07.524067","exception":false,"start_time":"2023-07-04T18:06:07.134726","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xV9f0/8M/NggAhIYAsFQMoQxAEVBQFF060iqOuilV/rat1dGitW9HWUbW2\nVqlSnKi1WhdftQoOigIOBFEZQrSyhRAgJJBxf39cuMYQIUAghPN8/nXyOefzOe97wsM83r7O\nPScWj8cDAAAAAAAAEA0pdV0AAAAAAAAAsO0ICAEAAAAAACBCBIQAAAAAAAAQIQJCAAAAAAAA\niBABIQAAAAAAAESIgBAAAAAAAAAiREAIAAAAAAAAESIgBAAAAAAAgAgREAIAAAAAAECECAgB\nAAAAAAAgQgSEAAAAAAAAECECQgAAAAAAAIgQASEAAAAAAABEiIAQAAAAAAAAIkRACAAAAAAA\nABEiIAQAAAAAAIAIERACAAAAAABAhAgIAQAAAAAAIEIEhAAAAAAAABAhAkIAAAAAAACIEAEh\nAAAAAAAAR